// import styles from "./DisplayUser.module.css";
import Card from "../UI/Card";
import DisplayUserItem from "./DisplayUserItem";

const DisplayUser = (props) => {

  return (
    <Card>
      {props.items.map((arr) => (
        <DisplayUserItem
          key={Math.random()}
          item={arr}
        >{`${props.items[0][0]} (${props.items[0][1]} years old) `}</DisplayUserItem>
      ))}
    </Card>
  );
};

export default DisplayUser;
